import React from "react";
import Model from "./Model";
import history from "../history";
import { connect } from "react-redux";
import { deleteStrems, fetchStrmes } from "../actions/index";
class DeleteStream extends React.Component {
  componentDidMount() {
    this.props.fetchStrmes(this.props.match.params.id);
  }
  handleFooter = () => (
    <>
      <button>Delete</button>
      <button>Cancle</button>
    </>
  );

  render() {
    return (
      <div>
        <h1>delete streame</h1>
        <Model
          title="Delete Strema"
          content="Are you sure to delete the strema?"
          footer={this.handleFooter()}
          handle={() => history.push("/")}
        />
      </div>
    );
  }
}
export default connect(null, { deleteStrems, fetchStrmes })(DeleteStream);
